import { makeReq } from "../../axios";
import Post from "../post/Post";
import "./posts.scss";
import {
  useQuery,
} from '@tanstack/react-query'
const Posts = () => {
  const { isLoading, error, data } = useQuery(['watchlist'], () =>
    makeReq.get("/watchlist").then((res) => {
      return res.data
    })
  );
const arrayDataItems = data.map((idpass, index) => (
    <li key={index}>
      <p>{idpass.stock_id}</p>
      <span>{idpass.current_price}</span>
    </li>
  ));
  return <div >
    {arrayDataItems}
  </div>;
};

export default Posts;
